<template>
    <layoutDefault>
        <div class="mb-3 mt-4">
            <h3 class="btn-blue w-100 text-center py-2">BIENVENIDO</h3>
        </div>
        <div class="text-center mb-3">
            <svg width="171" height="161" viewBox="0 0 171 161" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect width="171" height="161" fill="url(#pattern0)"/>
                <defs>
                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_10_215" transform="matrix(0.00195312 0 0 0.00207444 0 -0.0310559)"/>
                    </pattern>
                    <image id="image0_10_215" width="512" height="512" xlink:href="data:image/png;base64,"/>
                </defs>
            </svg>
        </div>
        <div class="post mb-4">
            <post-item-component v-for="postItem in postItems" :postItem=postItem></post-item-component>
        </div>
        <div class="navigation text-center mb-5">
            <button class="btn btn-blue btn-prev mx-1" @click="navigationPrev"> Prev </button>
            <button class="btn btn-blue btn-prev mX-1" @click="navigationNext"> Next </button>
        </div>
        <div>
            <p class="text-center mb-0 fw-bold">Te interes</p>
            <p class="text-center mb-0 fw-bold mb-3">Quieres formar parte de esta comunidad? :)</p>
            <p class="text-center mb-0 fw-bold"><router-link :to="{name:'register'}">Crea una cuenta</router-link></p>
            <p class="text-center mb-0 fw-bold"><router-link :to="{name:'login'}">Iniciar Sesin</router-link></p>
        </div>

    </layoutDefault>
</template>

<script>
    import layoutDefault from "@/layouts/Default.vue";
    import PostItemComponent from "@/components/post/PostItem.vue";
    import posts from "@/store/posts.js";
    export default {
        name: 'LoginView',
        components: {
            PostItemComponent,
            layoutDefault
        },
        data:function(){
            return {
                postItems:[
                ],
                page:1,
                totalPages:4,
            }
        },
        methods:{
            navigationPrev(){
                let view=this.page;
                view--;
                if (view<1){return;}
                this.page=view;
                this.listPost();
            },
            navigationNext(){
                let view=this.page;
                view++;
                if (view>this.totalPages){return}
                this.page=view;
                this.listPost();
            },
            listPost(){
                posts.getPosts(this.page).then(response=>{
                    if (response.success==true){
                        this.postItems=response.rows
                    }
                })
            }
        },
        mounted() {
            this.listPost();
        }
    }
</script>
